create database management_cafe;
use management_cafe;

create table product
(
ID int AUTO_INCREMENT PRIMARY KEY,
NAME varchar(80),
PRICE int,
QUANTITY int,
CREATED_DATE TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
UPDATED_DATE TIMESTAMP DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
STATUS enum('active','inactive'),
DESCRIPTION varchar(100),
IMAGE longtext
);
create table order_bill
(
ID int AUTO_INCREMENT PRIMARY KEY,
CREATED_DATE TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
STATUS ENUM('cancel','success'),
NOTE varchar(100),
phone varchar(100),
FOREIGN KEY (phone) REFERENCES customer(Phone),
diachi varchar(50),
TOTAL_COST int
);
create table order_details
(
O_ID int,
FOREIGN KEY (O_ID) REFERENCES order_bill(ID),
P_ID int,
FOREIGN KEY (P_ID) REFERENCES product(ID),
QUANTITY int,
COST int,
PRIMARY KEY(O_ID,P_ID)
);
create table user
(
ID int AUTO_INCREMENT PRIMARY KEY,
NAME varchar(100),
ROLE ENUM('admin','employee'),
ACCOUNT varchar(100),
PASSWORD varchar(50),
CREATED_DATE TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
UPDATED_DATE TIMESTAMP DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP
);
 create table import_products
 (
 I_ID int,
 FOREIGN KEY (I_ID) REFERENCES product(ID),
IMPORTED_QUANTITY INT,
CREATED_DATE TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
TOTAL_QUANTITY INT,
PRIMARY KEY(I_ID,CREATED_DATE)
);
create table customer
(
Phone varchar(10) primary key,
address varchar(225),
NAME varchar(50),
CREATED_DATE TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
UPDATED_DATE TIMESTAMP DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
STATUS enum('active','inactive')
);
create table employee
(
ID int primary key,
EName varchar(50),
EPhone varchar(10),
Address varchar(100),
Startdate date,
Email varchar(25),
Username varchar(15),
Password varchar(15)
);
create table discount
(
DiscountID int primary key,
DiscountName int,
Startdate date,
EndDate date,
P_ID int,
FOREIGN KEY (P_ID) REFERENCES product(ID)
);


